g5.getResult = function(buff, param) {
    var r = buff.indexOf(param);
    if (r < 0) return "";
    r = buff.indexOf("\"", r);
    if (r < 0) return "";
    r = buff.indexOf("\"", r + 1);
    if (r < 0) return "";
    r ++;
    var r1 = buff.indexOf("\"", r);
    if (r1 < 0) return;
    return buff.substring(r, r1);
}
